void generateA(int arr[NUM][NUM]) {
	for (int i = 0; i < NUM ; i++) {
		for (int j = 0; j < NUM ; j++) {
			arr[i][j] = arr[i][j] + i;
		}
	}
	return;
}


void generateB(int brr[NUM][NUM]) {
	for (int i = 0; i < NUM ; i++) {
		for (int j = 0; j < NUM ; j++) {
			brr[i][j] = brr[i][j] + j;
		}
	}
	return;
}


void calcute(int arr[NUM][NUM],int brr[NUM][NUM],int crr[NUM][NUM]) {
	int count = 0;
	for (int i = 0; i < NUM ; i++) {
		debugf(" =====================================================================================================================\n");
		for (int j = 0; j < NUM ; j++) {
			for (int k = 0; k < NUM ; k++) {
				crr[i][j] += arr[i][k] * brr[k][j];
			}
			if ( j == 0 ) {
				debugf(" || ");
			}
			debugf("%06x ",crr[i][j]);
			count++;
			if (count % MOD == 0 && j != NUM - 1) {
				debugf("|| \n || ");
			} else if ( count % MOD == 0 ) {
				debugf("|| \n");
			}
		}
		debugf(" =====================================================================================================================\n\n\n\n\n\n");
	}
	return;
}

int get_gap(int begin_time,int begin_us,int end_time,int end_us) {
	int gap = ((int)end_time -(int)begin_time);
	return gap;
}

int get_gap1(int begin_time,int begin_us,int end_time,int end_us) {
	int gap = ((int)end_time -(int)begin_time)  + ((int)end_us - (int)begin_us) / 1000;
	return gap;
}

